import React from 'react';

function Form (props) {
    return(
      <form
        className="input"
        onSubmit={(e) => this.props.onFormSubmit(e)}
      >
        <input
          placeholder="Whatcha Thinkin?"
          onChange={(e) => this.props.handleInputChange(e)}
          value={this.props.buttonInput.toUpperCase()}
         />
        <button>Abrah Kadavrah</button>
      </form>
      )
}

export default Form

